"use strict";(self.webpackChunkunityquest_chronicles_of_love=self.webpackChunkunityquest_chronicles_of_love||[]).push([[2572],{52312:(e,t,i)=>{i.r(t),i.d(t,{default:()=>o,johnChapter13PL:()=>n});const n={chapter:13,title:"Jean 13",version:"Gda\u0144sk Bible 1632",language:"pl",direction:"ltr",verses:[{number:1,text:"A przed \u015bwi\u0119tem wielkiejnocy, wiedz\u0105c Jezus, \u017ce przysz\u0142a godzina jego, aby przeszed\u0142 z tego \u015bwiata do Ojca, umi\u0142owawszy swoje, kt\xf3rzy byli na \u015bwiecie, do ko\u0144ca je umi\u0142owa\u0142.",strong:[{text:"monde",strong:"G2889",start:81,end:86},{text:"dans",strong:"H6887",start:132,end:136},{text:"monde",strong:"G2889",start:140,end:145},{text:"amour",strong:"G25",start:167,end:172}]},{number:2,text:"A gdy by\u0142a wieczerza, (a ju\u017c dyabel by\u0142 poda\u0142 w serce Judaszowi Szymonowi Iskaryjotczykowi, aby go zdradzi\u0142,)",strong:[{text:"fils",strong:"G5207",start:83,end:87}]},{number:3,text:"Wiedz\u0105c Jezus, \u017ce mu wszystko poda\u0142 Ojciec w r\u0119ce, i \u017ce od Boga wyszed\u0142, i do Boga idzie,",strong:[{text:"Dieu",strong:"G2316",start:93,end:97},{text:"Dieu",strong:"G2316",start:122,end:126}]},{number:4,text:"Wsta\u0142 od wieczerzy, i z\u0142o\u017cy\u0142 szaty swoje, a wzi\u0105wszy prze\u015bcierad\u0142o, przepasa\u0142 si\u0119.",strong:[{text:"table",strong:"H7979",start:11,end:16}]},{number:5,text:"Potem nala\u0142 wody w miednic\u0119, i pocz\u0105\u0142 umywa\u0107 nogi uczniom, i ociera\u0107 prze\u015bcierad\u0142em, kt\xf3rem by\u0142 przepasany.",strong:[{text:"dans",strong:"H6887",start:26,end:30},{text:"avec",strong:"G1848",start:105,end:109}]},{number:6,text:"Tedy przyszed\u0142 do Szymona Piotra, a ten mu rzek\u0142: Panie! ty mi masz umywa\u0107 nogi?",strong:[{text:"Seigneur",strong:"G2962",start:53,end:61}]},{number:7,text:"Odpowiedzia\u0142 Jezus i rzek\u0142 mu: Czego ja czyni\u0119, ty teraz nie wiesz; ale si\u0119 potem dowiesz.",strong:[]},{number:8,text:"Rzek\u0142 mu Piotr: Nie b\u0119dziesz mi umywa\u0142 n\xf3g na wieki. Odpowiedzia\u0142 mu Jezus: Je\u017ali ci\u0119 nie umyj\u0119, nie b\u0119dziesz mia\u0142 cz\u0119\u015bci ze mn\u0105.",strong:[{text:"avec",strong:"G1848",start:119,end:123}]},{number:9,text:"Rzek\u0142 mu Szymon Piotr: Panie! nie tylko n\xf3g moich, ale i r\u0119ce, i g\u0142ow\u0119.",strong:[{text:"Seigneur",strong:"G2962",start:22,end:30}]},{number:10,text:"Rzek\u0142 mu Jezus: Kto jest umyty, nie potrzebuje, tylko aby nogi umy\u0142, ale jest czysty wszytek; a wy czy\u015bci jeste\u015bcie, ale nie wszyscy.",strong:[{text:"besoin",strong:"H2637",start:38,end:44}]},{number:11,text:"Bo wiedzia\u0142, kto go mia\u0142 zdradzi\u0107, przeto\u017c rzek\u0142: Nie jeste\u015bcie wszyscy czy\u015bci.",strong:[]},{number:12,text:"A tak gdy umy\u0142 nogi ich, i wzi\u0105\u0142 szaty swoje, i zasi\u0119 usiad\u0142, rzek\u0142 im: Wiecie li, com wam uczyni\u0142?",strong:[{text:"table",strong:"H7979",start:84,end:89}]},{number:13,text:"Wy mi\u0119 zowiecie Mistrz, i Pan, a dobrze powiadacie; bom ja jest.",strong:[{text:"Seigneur",strong:"G2962",start:25,end:33},{text:"bien",strong:"H2896",start:49,end:53}]},{number:14,text:"Je\u017alim tedy ja, Pan i Mistrz, umy\u0142 nogi wasze, i wy\u015bcie powinni jeden drugiemu nogi umywa\u0107.",strong:[{text:"Seigneur",strong:"G2962",start:43,end:51}]},{number:15,text:"Albowiem przyk\u0142ad da\u0142em wam, aby\u015bcie i wy tak czynili, jakom ja wam uczyni\u0142.",strong:[{text:"comme",strong:"G2531",start:55,end:60}]},{number:16,text:"Zaprawd\u0119, zaprawd\u0119 powiadam wam: Nie jest s\u0142uga wi\u0119kszy nad pana swego, ani pose\u0142 wi\u0119kszy nad tego, kt\xf3ry go pos\u0142a\u0142.",strong:[{text:"serviteur",strong:"G1401",start:41,end:50},{text:"grand",strong:"G3173",start:66,end:71},{text:"seigneur",strong:"G2962",start:80,end:88},{text:"grand",strong:"G3173",start:107,end:112}]},{number:17,text:"Je\u017ali to wiecie, b\u0142ogos\u0142awieni jeste\u015bcie, je\u017ali to czynicie.",strong:[]},{number:18,text:"Nie o wszystkich was m\xf3wi\u0119; ja wiem, kt\xf3rem obra\u0142; ale aby si\u0119 wype\u0142ni\u0142o Pismo: Kt\xf3ry je ze mn\u0105 chleb, podni\xf3s\u0142 przeciwko mnie pi\u0119t\u0119 swoj\u0119.",strong:[{text:"avec",strong:"G1848",start:133,end:137},{text:"pain",strong:"G740",start:145,end:149},{text:"contre",strong:"G2596",start:167,end:173}]},{number:19,text:"Od teraz powiadam wam, pierwej ni\u017c si\u0119 stanie, aby\u015bcie, gdy si\u0119 stanie, uwierzyli, \u017cem ja jest.",strong:[]},{number:20,text:"Zaprawd\u0119, zaprawd\u0119 powiadam wam: Kto przyjmuje tego, kogokolwiek po\u015bl\u0119, mi\u0119 przyjmuje; a kto mi\u0119 przyjmuje, przyjmuje tego, kt\xf3ry mi\u0119 pos\u0142a\u0142.",strong:[]},{number:21,text:"To powiedziawszy Jezus, zk\u0142opota\u0142 si\u0119 w duchu, i o\u015bwiadczy\u0142, i rzek\u0142: Zaprawd\u0119, zaprawd\u0119 powiadam wam, \u017ce jeden z was mi\u0119 zdradzi.",strong:[{text:"esprit",strong:"G4151",start:44,end:50}]},{number:22,text:"Tedy si\u0119 ogl\u0105dali uczniowie jedni na drugich, w\u0105tpi\u0105c, o kt\xf3rym m\xf3wi\u0142.",strong:[]},{number:23,text:"A by\u0142 jeden z uczni\xf3w jego za sto\u0142em, kt\xf3ry odpoczywa\u0142 na \u0142onie Jezusowym, kt\xf3rego Jezus mi\u0142owa\u0142.",strong:[]},{number:24,text:"Temu tedy skin\u0105\u0142 Szymon Piotr, aby si\u0119 wywiedzia\u0142, kt\xf3ryby to by\u0142, o kt\xf3rym m\xf3wi\u0142.",strong:[{text:"signe",strong:"G4592",start:21,end:26},{text:"demander",strong:"G154",start:30,end:38}]},{number:25,text:"Tedy on przypu\u015bciwszy si\u0119 do piersi Jezusowych, rzek\u0142 mu: Panie! kt\xf3ry\u017c to jest?",strong:[{text:"disciple",strong:"G3101",start:6,end:14},{text:"Seigneur",strong:"G2962",start:66,end:74}]},{number:26,text:"Odpowiedzia\u0142 Jezus: Ten jest, kt\xf3remu ja omoczywszy sztuczk\u0119 chleba, podam. A omoczywszy sztuczk\u0119, da\u0142 Judaszowi Szymonowi Iskaryjotczykowi.",strong:[{text:"fils",strong:"G5207",start:115,end:119}]},{number:27,text:"A po onym k\u0119sie wst\u0105pi\u0142 we\u0144 szatan. Tedy mu rzek\u0142 Jezus: Co czynisz, czy\u0144 rychlej.",strong:[{text:"dans",strong:"H6887",start:42,end:46}]},{number:28,text:"A tego \u017caden z siedz\u0105cych za sto\u0142em nie zrozumia\u0142, na co mu to powiedzia\u0142.",strong:[{text:"aucun",strong:"G3762",start:5,end:10},{text:"table",strong:"H7979",start:33,end:38}]},{number:29,text:"Bo niekt\xf3rzy mniemali, i\u017c Judasz mia\u0142 mieszek, \u017ce mu Jezus m\xf3wi\u0142: Kup, czego nam potrzeba na \u015bwi\u0119to; albo aby co ubogim da\u0142.",strong:[{text:"comme",strong:"G2531",start:32,end:37},{text:"dire",strong:"H559",start:79,end:83},{text:"besoin",strong:"H2637",start:111,end:117},{text:"donner",strong:"G1325",start:159,end:165}]},{number:30,text:"A on wzi\u0105wszy sztuczk\u0119, wyszed\u0142 natychmiast; a by\u0142a noc.",strong:[{text:"nuit",strong:"G3571",start:58,end:62}]},{number:31,text:"A gdy on wyszed\u0142, rzek\u0142 Jezus: Teraz jest uwielbion Syn cz\u0142owieczy, i B\xf3g jest uwielbion w nim.",strong:[{text:"Fils",strong:"G5207",start:51,end:55},{text:"homme",strong:"G444",start:61,end:66},{text:"Dieu",strong:"G2316",start:86,end:90}]},{number:32,text:"Je\u017ali B\xf3g jest uwielbion w nim, i B\xf3g go uwielbi w sobie, a wnet\u017ce go uwielbi.",strong:[{text:"Dieu",strong:"G2316",start:3,end:7},{text:"Dieu",strong:"G2316",start:31,end:35}]},{number:33,text:"Dziateczki! jeszcze maluczko z wami jestem; szuka\u0107 mi\u0119 b\u0119dziecie, ale jakom powiedzia\u0142 \u017bydom: Dok\u0105d ja id\u0119, wy przyj\u015b\u0107 nie mo\u017cecie, tak i wam teraz powiadam.",strong:[{text:"avec",strong:"G1848",start:53,end:57},{text:"comme",strong:"G2531",start:88,end:93}]},{number:34,text:"Przykazanie nowe daj\u0119 wam, aby\u015bcie si\u0119 spo\u0142ecznie mi\u0142owali; jakom ja was umi\u0142owa\u0142, aby\u015bcie si\u0119 i wy spo\u0142ecznie mi\u0142owali.",strong:[{text:"commandement",strong:"G1785",start:17,end:29},{text:"nouveau",strong:"G2537",start:30,end:37},{text:"comme",strong:"G2531",start:70,end:75}]},{number:35,text:"Po tem poznaj\u0105 wszyscy, \u017ce\u015bcie uczniowie moi, je\u017ali mi\u0142o\u015b\u0107 mie\u0107 b\u0119dziecie spo\u0142ecznie mi\u0119dzy sob\u0105.",strong:[{text:"ceci",strong:"G3778",start:2,end:6},{text:"amour",strong:"G25",start:71,end:76}]},{number:36,text:"Rzek\u0142 mu Szymon Piotr: Panie! dok\u0105d idziesz? Odpowiedzia\u0142 mu Jezus: Dok\u0105d ja id\u0119, nie mo\u017cesz mi\u0119 teraz i\u015b\u0107 za mn\u0105; ale p\xf3jdziesz potem.",strong:[{text:"Seigneur",strong:"G2962",start:22,end:30}]},{number:37,text:"Rzek\u0142 mu Piotr: Panie! czemu\u017c teraz nie mog\u0119 i\u015b\u0107 za tob\u0105? Dusz\u0119 moj\u0119 za ciebie po\u0142o\u017c\u0119.",strong:[{text:"Seigneur",strong:"G2962",start:0,end:8}]},{number:38,text:"Odpowiedzia\u0142 mu Jezus: Dusz\u0119 twoj\u0119 za mi\u0119 po\u0142o\u017cysz? zaprawd\u0119, zaprawd\u0119 powiadam tobie: Nie zapieje kogut, a\u017c mi\u0119 trzy kro\u0107 zaprzesz.",strong:[]}]},o=n}}]);
